import React, { useState } from "react";
import { Table } from 'antd';

const columns = [
  {
    title: 'Mentor',
    width: 100,
    dataIndex: 'Mentor',
    key: 'Mentor',
    fixed: 'left',
  },
  {
    title: 'Pending Companies',
    width: 100,
    dataIndex: 'Companies',
    key: 'Companies',
    fixed: 'left',
  },
  {
    title: 'Action',
    key: 'operation',
    fixed: 'right',
    width: 100,
    render: () => <a>action</a>,
  },
];

const TableReschedule = ({pendingMeetings}) => {
  return (
  <Table columns={columns} dataSource={pendingMeetings} scroll={{ x: 1500, y: 300 }} pagination={{ pageSize: 50 }} />
    );
  }

export default TableReschedule;
